stid>\" and \"<sheetname>\" and clicks on sign in\n    Then The user should land on the homepage and see 7 panes of different data structures \n    When The user selects each data structure item from the dropdown\n    Then The user should be directed to the respective data structure page\n   \n     Examples:\n    |testid|sheetname|\n    |    2  |  Login |\n    \n    \n     @tes003\n    Scenario Outline: Test if the user is able to navigate to data structure pages from clicking getstarted button after signing in \n    Given The user is in the homepage\n    When The user clicks on sign in button\n    And The user enters the valid credentials from data sheet under \"<testid>\" and \"<sheetname>\" and clicks on sign in\n    Then The user should land on the homepage and see 7 panes of different data structures \n     When The user clicks on get started button of each data structure and navigates back\n     Then The user should be directed to the respective data structure page\n      Examples:\n    |testid|sheetname|\n    |    2  |  Login |\n    ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/ezhilvanan/eclipse-workspace/SDET/DS_AlgoAll/src/test/resources/feature/homepagefun.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":2,"column":1},"name":"@homepge","id":"c817d696-1b6c-4a17-ab1c-953ebc602119"}],"language":"en","keyword":"Feature","name":"Home page functionality","description":"","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@tes003","id":"6f7cabf6-4ed8-4239-922d-794eda477f07"}],"keyword":"Scenario","name":"Test if the user is able to navigate to the homepage from portal page","description":"","steps":[{"location":{"line":7,"column":5},"keyword":"Given ","text":"The user is in the portal page","id":"d60827f1-cb8c-4a0d-8fc9-72069d32cfaa"},{"location":{"line":8,"column":5},"keyword":"When ","text":"The user clicks on the get started butt
